import logo from "./logo.svg";
import "./App.css";
import { useEffect, useState } from "react";
import Table from "./Table";
import axios from "axios";

function ReadData() {
  const [uuid, setUUID] = useContext(Context);
  const [inputParams, setInputParams] = useState({
    azureStorageAccountName: "",
    azureContainerName: "",
    azureFilePath: "",
    azureFileName: "",
    azureConditionId: "",
    sparkSessionUUID: "",
  });
  const [headers, setHeaders] = useState([]);
  const [tableData, setTableData] = useState([]);

  useEffect(() => {
    if (tableData.length > 0) {
      setHeaders(Object.keys(tableData[0]));
    }
  }, [tableData]);

  function loadData() {
    // axios.get("http://localhost:8080/api/spark/read/taxidata").then((data) => {
    //   setTableData(data.data);
    // });
    console.log(inputParams);
  }

  return (
    <div className="App">
      <h1>Form</h1>
      <form onSubmit={() => loadData()}>
        <div className="form-element">
          <label>Storage Account Name</label>
          <input
            value={inputParams.azureStorageAccountName}
            onChange={(event) =>
              setInputParams({
                ...inputParams,
                azureStorageAccountName: event.target.value,
              })
            }
          ></input>
        </div>

        <div className="form-element">
          <label>Container Name</label>
          <input
            value={inputParams.azureContainerName}
            onChange={(event) =>
              setInputParams({
                ...inputParams,
                azureContainerName: event.target.value,
              })
            }
            x
          ></input>
        </div>
        <div className="form-element">
          <label>File Path</label>
          <input
            value={inputParams.azureFilePath}
            onChange={(event) =>
              setInputParams({
                ...inputParams,
                azureFilePath: event.target.value,
              })
            }
          ></input>
        </div>
        <div className="form-element">
          <label>File Name</label>
          <input
            value={inputParams.azureFileName}
            onChange={(event) =>
              setInputParams({
                ...inputParams,
                azureFileName: event.target.value,
              })
            }
          ></input>
        </div>
        <div className="form-element">
          <label>Condition</label>
          <input
            value={inputParams.azureConditionId}
            onChange={(event) =>
              setInputParams({
                ...inputParams,
                azureConditionId: event.target.value,
              })
            }
          ></input>
        </div>
        <div className="form-element js-center">
          <input
            className="display-button"
            type="submit"
            value="Display Data"
          ></input>
        </div>
      </form>

      <h1>Display table data</h1>
      <div className="table">
        <Table headers={headers} data={tableData}></Table>
      </div>
    </div>
  );
}

export default ReadData;
